enum ActionKind {
    Walking,
    Idle,
    Jumping,
    rain
}
namespace SpriteKind {
    export const BOX = SpriteKind.create()
    export const Button = SpriteKind.create()
    export const rain = SpriteKind.create()
}
/**
 * BANNED
 */
controller.up.onEvent(ControllerButtonEvent.Pressed, function () {
    if (level > 0) {
        if (CAT.vy == 0) {
            CAT.vy = -142
            music.setVolume(255)
            music.play(music.createSoundEffect(WaveShape.Square, 400, 600, 255, 0, 100, SoundExpressionEffect.None, InterpolationCurve.Linear), music.PlaybackMode.UntilDone)
            while (CAT.vy == 0) {
                CAT.vy += 10
                break;
            }
        }
    }
})
function SIDE_EFFECT (sideeffect: string) {
    CAT.sayText(sideeffect, 2000, true)
    if (sideeffect.includes("jump")) {
        pause(1000)
        CAT.ay = 200
    } else if (!(sideeffect.includes("jump"))) {
        CAT.ay = 300
    }
}
