function FishSpawning (Fish: Image) {
    FISHES = sprites.create(Fish, SpriteKind.Food)
    scaling.scaleByPercent(FISHES, -80, ScaleDirection.Uniformly, ScaleAnchor.Middle)
    if (level == 2) {
        tiles.placeOnTile(FISHES, tiles.getTileLocation(14, 4))
    } else if (level == 3) {
        tiles.placeOnRandomTile(FISHES, assets.tile`myTile39`)
    } else if (level == 4) {
        tiles.placeOnRandomTile(FISHES, assets.tile`myTile46`)
        scaling.scaleByPercent(FISHES, -5, ScaleDirection.Uniformly, ScaleAnchor.Middle)
    } else if (level == 5) {
        tiles.placeOnRandomTile(FISHES, assets.tile`myTile6`)
    }
}
